import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import "../../styles/AdBooking.css";

const AdBooking = () => {
  const [selectedNewspaper, setSelectedNewspaper] = useState("");
  const navigate = useNavigate();

  const handleSelectNewspaper = (event) => {
    setSelectedNewspaper(event.target.value);
  };

  const handleProceed = () => {
    if (selectedNewspaper) {
      navigate(`/newspaper-layout?newspaper=${selectedNewspaper}`); // Redirect to layout page
    } else {
      alert("Please select a newspaper.");
    }
  };

  return (
    <div className="booking-container">
      <h2>Select a Newspaper</h2>
      <select value={selectedNewspaper} onChange={handleSelectNewspaper}>
        <option value="">-- Select Newspaper --</option>
        <option value="The Times">The Times</option>
        <option value="The Daily News">The Daily News</option>
        <option value="The Chronicle">The Chronicle</option>
      </select>
      <button onClick={handleProceed}>Proceed</button>
    </div>
  );
};

export default AdBooking;
